import axios from "axios"

const baseUrl="https://s3-eu-west-1.amazonaws.com/course.oc-static.com/projects/Front-End+V2/P9+React+1/logements.json"


function App() {
	return (
		axios.get(baseUrl).then((res)=>{
      console.log(res.id)
      })
	);
}

export default App;
